soup = BeautifulSoup(html, "html.parser")

rows = soup.find_all("tr")[1:]  # bỏ dòng tiêu đề

vocab_list = []
for row in rows:
    cols = row.find_all("td")
    han = cols[0].get_text(strip=True)
    vi = cols[2].get_text(strip=True)
    vocab_list.append({"vi": vi, "han": han})

# Xuất ra dạng JavaScript
print("const vocabulary = [")
for item in vocab_list:
    print(f'    {{ "vi": "{item["vi"]}", "han": "{item["han"]}" }},')
print("];")
